import React, { useState, useEffect } from "react";
import { FaUser, FaBars } from "react-icons/fa";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import "./Navbar.css";

function Navbar({ isLoggedIn }) {
  const [menuOpen, setMenuOpen] = useState(false);
  const [userData, setUserData] = useState(null); // State for user data
  const navigate = useNavigate();

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  console.log("Is User Logged In?", isLoggedIn);

  useEffect(() => {
    // Function to fetch user data
    const fetchUserData = async () => {
      try {
        // Make a request to fetch user data (replace with your API endpoint)
        const response = await fetch("YOUR_USER_DATA_ENDPOINT");
        const data = await response.json();

        // Assuming the user's name is in the "name" field of the response
        setUserData(data.name);
      } catch (error) {
        console.error("Error fetching user data:", error);
      }
    };

    // Fetch user data if the user is logged in
    if (isLoggedIn) {
      fetchUserData();
    }
  }, [isLoggedIn]);

  const handleLogout = () => {
    localStorage.removeItem("authToken");
    // Reset user-related state
    setUserData(null);

    // Redirect to the home page
    navigate("/");
  };

  return (
    <nav className={`navbar ${menuOpen ? "menu-open" : ""}`}>
      <div className="nav-left">
        <Link to="/" className="nav-logo">
          iBlog.
        </Link>
      </div>
      <div className="nav-toggle" onClick={toggleMenu}>
        <FaBars className="menu-icon" />
      </div>
      <ul className={`nav-list ${menuOpen ? "menu-open" : ""}`}>
        <li className="nav-item">
          <Link to="/" className="nav-link">
            Home
          </Link>
        </li>
        {/* Other menu items */}
        <li className="nav-item">
          {isLoggedIn ? (
            <span className="nav-link">Welcome, {userData}</span>
          ) : (
            <Link to="/auth" className="nav-link">
              <FaUser className="user-icon" />
            </Link>
          )}
        </li>
        {isLoggedIn && (
          <>
            <li className="nav-item">
              <Link to="/portfolio" className="nav-link">
                Portfolio
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/createpost" className="nav-link">
                Create
              </Link>
            </li>
            <li className="nav-item">
              <button onClick={handleLogout} className="nav-link">
                Logout
              </button>
            </li>
          </>
        )}
      </ul>
    </nav>
  );
}

export default Navbar;
